import React from 'react';
import './logo.css';

class Logo extends React.Component {
    render() {
        return(
            <React.Fragment>
                <a class="navbar-item block" href="#header">
                    <h2 >Ziyad Guluzade</h2>
                </a>
            </React.Fragment>

        )
    }
}

export default Logo;
